import React from 'react';
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";

export default function App() {
  return(
    <Router>
      <Routes>
        <Routes exact path="/" element={<App/>}/>
        <Routes path="*" />
      </Routes>
    </Router>
  ) ;
}
